import React, { Component } from 'react';
import { Link } from 'react-router-dom';

const Navbar=()=>{
    return (
        <div>
        <ul>
            <li><Link to='/home'>Home</Link></li>
            <li><Link to='/summary'>Summary</Link></li>
            <li><Link to='/rooms'>Rooms</Link></li>
        </ul>
        </div>
    )
}


export default Navbar;
